import React, {lazy, Component, useState, useEffect} from "react";
import {data} from "../../data";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faTh, faBars} from "@fortawesome/free-solid-svg-icons";
import axios from "../Request/RequestConfig";
// import SoftwareData from "./SoftwareData";
// import {useNavigate} from "react-router-dom";
// import axios from "../Request/RequestConfig";

//import SoftwareData from "./SoftwareData";

const Paging = lazy(() => import("../../components/Paging"));
//const SoftwareData = lazy(() => import("./SoftwareData"));

const Breadcrumb = lazy(() => import("../../components/Breadcrumb"));
const FilterCategory = lazy(() => import("../../components/filter/Category"));
const FilterPrice = lazy(() => import("../../components/filter/Price"));
const FilterSize = lazy(() => import("../../components/filter/Size"));
const FilterStar = lazy(() => import("../../components/filter/Star"));
const FilterColor = lazy(() => import("../../components/filter/Color"));
const FilterTag = lazy(() => import("../../components/filter/Tag"));
const FilterClear = lazy(() => import("../../components/filter/Clear"));
const CardServices = lazy(() => import("../../components/card/CardServices"));

const CardProductGrid = lazy(() => import("../../components/card/CardProductGrid"));
const CardProductList = lazy(() => import("../../components/card/CardProductList"));


class ProductListView extends Component {

    state = {
        currentProducts: [],
        currentPage: null,
        totalPages: null,
        totalItems: 0,
        view: "list",
    };


    UNSAFE_componentWillMount() {
        const totalItems = this.getProducts();
        this.setState({totalItems});
    }

    onPageChanged = (page) => {
        let products = this.getProducts();
        const {currentPage, totalPages, pageLimit} = page;
        const offset = (currentPage - 1) * pageLimit;
        const currentProducts = products.slice(offset, offset + pageLimit);
        this.setState({currentPage, currentProducts, totalPages});
    };

    onChangeView = (view) => {
        this.setState({view});
    };




    getProducts = async () => {
            try {
                const accessToken = localStorage.getItem('accessToken');
                const refreshToken = localStorage.getItem('refreshToken');

                if (accessToken && refreshToken) {
                    const response = await axios.get('/auth/software', {
                        headers: {
                            'Content-Type': 'application/json',
                            'Authorization': `Bearer ${accessToken}`,
                            'RefreshToken': `Bearer ${refreshToken}`,
                        },
                    });

                    if (response.status === 200) {
                        const data = response.data;
                        console.log(data.data);

                        const boardData = data.map(async (currentProduct) => ({
                            id: currentProduct.id,
                            sku: "FAS-01",
                            link: currentProduct.link,
                            title: currentProduct.title,
                            img: currentProduct.content.thumbnail,
                            price: currentProduct.content.price,
                            originPrice: currentProduct.content.originPrice,
                            discountPrice: currentProduct.content.discountPrice,
                            discountPercentage: currentProduct.content.discountPercentage,
                            isNew: currentProduct.content.isNew,
                            isHot: currentProduct.content.isHot,
                            star: currentProduct.content.star,
                            isFreeShipping: currentProduct.content.isFreeShipping,
                            description: currentProduct.content.content,
                        }));
                        const boardPG = await Promise.all(boardData);
                        this.setState({ currentProducts: boardPG, totalItems: boardPG.length });
                    } else {
                        console.log('인증된 유저만 접근 가능합니다.');
                    }
                } else {
                    console.log('로그인이 필요합니다.');
                }
            } catch (error) {
                console.error('인증되지 않은 사용자가 접근하려 합니다..', error);
                console.log('인증된 유저만 접근 가능합니다.');
            }
    }



    render() {
        return (
            <React.Fragment>
                <div
                    className="p-5 bg-primary bs-cover"
                    style={{
                        backgroundImage: "url(../../images/banner/50-Banner.webp)",
                    }}
                >
                    <div className="container text-center">
            <span className="display-5 px-3 bg-white rounded shadow">
              T-Shirts
            </span>
                    </div>
                </div>

                <br/>
                <div className="container-fluid mb-3">
                    <div className="row">
                        <div className="col-md-3">
                            <FilterCategory/>
                            <FilterPrice/>
                            <FilterStar/>
                            <CardServices/>
                        </div>
                        <div className="col-md-9">
                            <div className="row">
                                <div className="col-7">
                  <span className="align-middle fw-bold">
                    {this.state.totalItems} results for{" "}
                      <span className="text-warning">""</span>
                  </span>
                                </div>
                                <div className="col-5 d-flex justify-content-end">
                                    <select
                                        className="form-select mw-180 float-start"
                                        aria-label="Default select"
                                    >
                                        <option value={1}>Most Popular</option>
                                        <option value={2}>Latest items</option>
                                        <option value={3}>Trending</option>
                                        <option value={4}>Price low to high</option>
                                        <option value={4}>Price high to low</option>
                                    </select>
                                    <div className="btn-group ms-3" role="group">
                                        <button
                                            aria-label="Grid"
                                            type="button"
                                            onClick={() => this.onChangeView("grid")}
                                            className={`btn ${
                                                this.state.view === "grid"
                                                    ? "btn-primary"
                                                    : "btn-outline-primary"
                                            }`}
                                        >
                                            <FontAwesomeIcon icon={faTh}/>
                                        </button>
                                        <button
                                            aria-label="List"
                                            type="button"
                                            onClick={() => this.onChangeView("list")}
                                            className={`btn ${
                                                this.state.view === "list"
                                                    ? "btn-primary"
                                                    : "btn-outline-primary"
                                            }`}
                                        >
                                            <FontAwesomeIcon icon={faBars}/>
                                        </button>
                                    </div>
                                </div>
                            </div>
                            <hr/>
                            <div className="row g-3">
                                {this.state.view === "grid" &&
                                    this.state.currentProducts.map((product, idx) => {
                                        return (
                                            <div key={idx} className="col-md-4">
                                                <CardProductGrid data={product}/>
                                            </div>
                                        );
                                    })}
                                {this.state.view === "list" &&
                                    this.state.currentProducts.map((product, idx) => {
                                        return (
                                            <div key={idx} className="col-md-12">
                                                <CardProductList data={product}/>
                                            </div>
                                        );
                                    })}
                            </div>
                            <hr/>
                            <Paging
                                totalRecords={this.state.totalItems}
                                pageLimit={9}
                                pageNeighbours={3}
                                onPageChanged={this.onPageChanged}
                                sizing=""
                                alignment="justify-content-center"
                            />
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default ProductListView;
